    const {data,loading} = useFetchData("http://localhost:3004/api/blog")
    useEffect(()=>{
        const authenticate = async()=>{
            await fetch("http://localhost:3004/authenticate",{
                method:"POST"
            })
        }
        authenticate();
    },[])
    console.log(data)
  return (
    <div className='px-20 text-black'>
        {/* <div>
            {data.map((blog)=>{
